import styled from 'styled-components';


export const Container = styled.div`
    background-color: #136713;
    border-radius: 10px;
    padding: 20px;

`;

export const Logo = styled.img`
    width: auto;
    height: 70px;
`;

export const SearchInput = styled.img`
    width: auto;
    height: 70px;
`;
